import { isArray } from '../checks/isArray';
import { isDefined } from '../checks/isDefined';
import { isNumber } from '../checks/isNumber';
import { isString } from '../checks/isString';
import { isUndefined } from '../checks/isUndefined';
import { mustBeDefined } from '../checks/mustBeDefined';
import { mustBeInteger } from '../checks/mustBeInteger';
import { mustSatisfy } from '../checks/mustSatisfy';
import { blade } from './Blade';
import { FieldAdapter } from './FieldAdapter';
import { gpE } from './gpE';
import { gpG } from './gpG';
import { gpL } from './gpL';
import { isScalar } from './isScalar';
import { lcoE } from './lcoE';
import { lcoG } from './lcoG';
import { lcoL } from './lcoL';
import { Algebra, Blade, Metric, Multivector } from './Multivector';
import { multivectorEQ } from './multivectorEQ';
import { multivectorGE } from './multivectorGE';
import { multivectorGT } from './multivectorGT';
import { multivectorLE } from './multivectorLE';
import { multivectorLT } from './multivectorLT';
import { rcoE } from './rcoE';
import { rcoG } from './rcoG';
import { rcoL } from './rcoL';
import { simplify } from './simplify';

type METRIC<T> = number | number[] | Metric<T>;

/**
 * The JavaScript Bitwise operators use 32-bit signed numbers.
 * &  AND
 * |  OR
 * ~  NOT
 * ^  XOR
 * << Left shift (LHS is what is shifted, RHS is number of bits)
 * >> Right shift
 */

function isMultivector<T>(arg: any): arg is Multivector<T> {
    if (arg) {
        return typeof arg['extractGrade'] === 'function';
    }
    else {
        return false;
    }
}
function isMetric(arg: Metric<any>): arg is Metric<any> {
    return typeof arg.getEigenMetric === 'function';
}

/**
 * Computes the dimension of the vector space from the metric.
 */
function dim<T>(metric: number | number[] | Metric<T>): number {
    if (isNumber(metric)) {
        return metric;
    }
    else if (isArray(metric)) {
        return metric.length;
    }
    else if (isUndefined(metric)) {
        throw new Error("metric is undefined");
    }
    else if (isMetric(metric)) {
        return metric.getEigenMetric().length;
    }
    else {
        throw new Error("metric is undefined");
    }
}

function add<T>(lhs: T | Multivector<T>, rhs: T | Multivector<T>, algebra: Algebra<T>, metric: METRIC<T>, labels: string[]): Multivector<T> | undefined {
    const field = algebra.field;
    if (field.isField(lhs) && isMultivector(rhs)) {
        const rez: Blade<T>[] = [];
        rez.push(blade(0, lhs, field));
        for (let k = 0; k < rhs.blades.length; k++) {
            rez.push(rhs.blades[k]);
        }
        return mv(simplify(rez, field), algebra, metric, labels);
    }
    else if (isMultivector(lhs) && field.isField(rhs)) {
        const rez: Blade<T>[] = [];
        rez.push(blade(0, rhs, field));
        for (let k = 0; k < lhs.blades.length; k++) {
            rez.push(lhs.blades[k]);
        }
        return mv(simplify(rez, field), algebra, metric, labels);
    }
    else {
        if (isMultivector(lhs) && isMultivector(rhs)) {
            const rez: Blade<T>[] = [];
            for (let i = 0; i < lhs.blades.length; i++) {
                rez.push(lhs.blades[i]);
            }
            for (let k = 0; k < rhs.blades.length; k++) {
                rez.push(rhs.blades[k]);
            }
            return mv(simplify(rez, field), algebra, metric, labels);
        }
        else {
            // We'll be using this function for operator overloading.
            return void 0;
        }
    }
}

function sub<T>(lhs: T | Multivector<T>, rhs: T | Multivector<T>, algebra: Algebra<T>, metric: METRIC<T>, labels: string[]): Multivector<T> | undefined {
    const field = algebra.field;
    if (field.isField(lhs) && isMultivector(rhs)) {
        const rez: Blade<T>[] = [];
        rez.push(blade(0, lhs, field));
        for (let k = 0; k < rhs.blades.length; k++) {
            rez.push(rhs.blades[k].__neg__());
        }
        return mv(simplify(rez, field), algebra, metric, labels);
    }
    else if (isMultivector(lhs) && field.isField(rhs)) {
        const rez: Blade<T>[] = [];
        rez.push(blade(0, field.neg(rhs), field));
        for (let k = 0; k < lhs.blades.length; k++) {
            rez.push(lhs.blades[k]);
        }
        return mv(simplify(rez, field), algebra, metric, labels);
    }
    else {
        if (isMultivector(lhs) && isMultivector(rhs)) {
            const rez: Blade<T>[] = [];
            for (let i = 0; i < lhs.blades.length; i++) {
                rez.push(lhs.blades[i]);
            }
            for (let k = 0; k < rhs.blades.length; k++) {
                rez.push(rhs.blades[k].__neg__());
            }
            return mv(simplify(rez, field), algebra, metric, labels);
        }
        else {
            // We'll be using this function for operator overloading.
            return void 0;
        }
    }
}

function mul<T>(lhs: T | Multivector<T>, rhs: T | Multivector<T>, algebra: Algebra<T>, metric: METRIC<T>, labels: string[]): Multivector<T> | undefined {
    const field = algebra.field;
    if (field.isField(lhs) && isMultivector(rhs)) {
        return rhs.mulByScalar(lhs);
    }
    else if (isMultivector(lhs) && field.isField(rhs)) {
        return lhs.mulByScalar(rhs);
    }
    else {
        if (isMultivector(lhs) && isMultivector(rhs)) {
            const rez: Blade<T>[] = [];
            for (let i = 0; i < lhs.blades.length; i++) {
                const B1 = lhs.blades[i];
                for (let k = 0; k < rhs.blades.length; k++) {
                    const B2 = rhs.blades[k];
                    if (isNumber(metric)) {
                        const B = gpE(B1, B2, field);
                        rez.push(B);
                    }
                    else if (isArray(metric)) {
                        const B = gpL(B1, B2, <number[]>metric, field);
                        rez.push(B);
                    }
                    else {
                        const B = gpG(B1, B2, <Metric<T>>metric, field);
                        for (let b = 0; b < B.length; b++) {
                            rez.push(B[b]);
                        }
                    }
                }
            }
            return mv(simplify(rez, field), algebra, metric, labels);
        }
        else {
            // We'll be using this function for operator overloading.
            return void 0;
        }
    }
}

function div<T>(lhs: T | Multivector<T>, rhs: T | Multivector<T>, algebra: Algebra<T>): Multivector<T> | undefined {
    const field = algebra.field;
    if (field.isField(lhs) && isMultivector(rhs)) {
        throw new Error(`Multivector division is not yet supported. ${lhs} / ${rhs}`);
    }
    else if (isMultivector(lhs) && field.isField(rhs)) {
        return lhs.divByScalar(rhs);
    }
    else {
        if (isMultivector(lhs) && isMultivector(rhs)) {
            if (isScalar(rhs)) {
                return lhs.divByScalar(rhs.scalarCoordinate());
            }
            else {
                throw new Error(`Multivector division is not yet supported. ${lhs} / ${rhs}`);
            }
        }
        else {
            // We'll be using this function for operator overloading.
            return void 0;
        }
    }
}

/**
 * Returns the basis vector with index in the integer range [0 ... dim)
 */
function getBasisVector<T>(index: number, algebra: Algebra<T>, metric: METRIC<T>, labels: string[]): Multivector<T> {
    mustBeInteger('index', index);
    mustBeDefined('algebra', algebra);
    const field = algebra.field;
    const B = blade(1 << index, field.one, field);
    return mv<T>([B], algebra, metric, labels);
}

/**
 * Returns a scalar Multivector.
 */
function getScalar<T>(weight: T, algebra: Algebra<T>, metric: METRIC<T>, labels: string[]): Multivector<T> {
    mustBeDefined('algebra', algebra);
    const field = algebra.field;
    mustSatisfy('weight', field.isField(weight), () => { return `be a field value`; });
    const B = blade(0, weight, field);
    return mv<T>([B], algebra, metric, labels);
}

function mv<T>(blades: Blade<T>[], algebra: Algebra<T>, metric: METRIC<T>, labels: string[]) {
    if (!isArray(blades)) {
        throw new Error("blades must be Blade<T>[]");
    }
    if (isUndefined(algebra)) {
        throw new Error("algebra must be defined");
    }
    // const metric = G.metric;
    const field = algebra.field;
    const extractGrade = function (grade: number): Multivector<T> {
        const rez: Blade<T>[] = [];
        for (let i = 0; i < blades.length; i++) {
            const B = blades[i];
            if (B.grade() === grade) {
                rez.push(B);
            }
        }
        return mv(rez, algebra, metric, labels);
    };
    const that: Multivector<T> = {
        get blades() {
            return blades;
        },
        __abs__(): Multivector<T> {
            return that.scp(that.rev()).sqrt();
        },
        add(rhs: Multivector<T>): Multivector<T> {
            return add(that, rhs, algebra, metric, labels) as Multivector<T>;
        },
        __add__(rhs: Multivector<T>): Multivector<T> {
            return add(that, rhs, algebra, metric, labels) as Multivector<T>;
        },
        __radd__(lhs: Multivector<T>): Multivector<T> {
            return add(lhs, that, algebra, metric, labels) as Multivector<T>;
        },
        sub(rhs: Multivector<T>): Multivector<T> {
            return sub(that, rhs, algebra, metric, labels) as Multivector<T>;
        },
        __sub__(rhs: Multivector<T>): Multivector<T> {
            return sub(that, rhs, algebra, metric, labels) as Multivector<T>;
        },
        __rsub__(lhs: Multivector<T>): Multivector<T> {
            return sub(lhs, that, algebra, metric, labels) as Multivector<T>;
        },
        __eq__(rhs: Multivector<T>): boolean {
            return multivectorEQ(that, rhs, field);
        },
        __ge__(rhs: Multivector<T>): boolean {
            return multivectorGE(that, rhs, field);
        },
        __gt__(rhs: Multivector<T>): boolean {
            return multivectorGT(that, rhs, field);
        },
        __le__(rhs: Multivector<T>): boolean {
            return multivectorLE(that, rhs, field);
        },
        __lt__(rhs: Multivector<T>): boolean {
            return multivectorLT(that, rhs, field);
        },
        __ne__(rhs: Multivector<T>): boolean {
            return !multivectorEQ(that, rhs, field);
        },
        inv(): Multivector<T> {
            // We'll start by trying the versor inverse before doing the general inverse.
            const reverse = that.rev();
            const denom = that.mul(reverse);
            // If we have a scalar, then we can compute the versor inverse
            if (denom.blades.length === 1 && denom.blades[0].bitmap === 0) {
                return reverse.divByScalar(denom.scalarCoordinate());
            }
            else {
                throw new Error(`non-invertible multivector (versor inverse) ${that}`);
            }
        },
        isZero(): boolean {
            return blades.length === 0;
        },
        mul(rhs: Multivector<T>): Multivector<T> {
            return mul(that, rhs, algebra, metric, labels) as Multivector<T>;
        },
        mulByScalar(: T): Multivector<T> {
            const rez: Blade<T>[] = [];
            for (let i = 0; i < blades.length; i++) {
                const B = blades[i];
                const scale = field.mul(B.weight, );
                if (!field.isZero(scale)) {
                    rez.push(blade(B.bitmap, scale, field));
                }
            }
            return mv(rez, algebra, metric, labels);
        },
        __mul__(rhs: T | Multivector<T>): Multivector<T> {
            return mul(that, rhs, algebra, metric, labels) as Multivector<T>;
        },
        __rmul__(lhs: T | Multivector<T>): Multivector<T> {
            return mul(lhs, that, algebra, metric, labels) as Multivector<T>;
        },
        __div__(rhs: T | Multivector<T>): Multivector<T> {
            return div(that, rhs, algebra) as Multivector<T>;
        },
        __lshift__(rhs: Multivector<T>): Multivector<T> {
            const rez: Blade<T>[] = [];
            for (let i = 0; i < blades.length; i++) {
                const B1 = blades[i];
                for (let k = 0; k < rhs.blades.length; k++) {
                    const B2 = rhs.blades[k];
                    if (isNumber(metric)) {
                        const B = lcoE(B1, B2, field);
                        rez.push(B);
                    }
                    else if (isArray(metric)) {
                        const B = lcoL(B1, B2, <number[]>metric, field);
                        rez.push(B);
                    }
                    else {
                        const B = lcoG(B1, B2, <Metric<T>>metric, field);
                        for (let b = 0; b < B.length; b++) {
                            rez.push(B[b]);
                        }
                    }
                }
            }
            return mv(simplify(rez, field), algebra, metric, labels);
        },
        __rshift__(rhs: Multivector<T>): Multivector<T> {
            const rez: Blade<T>[] = [];
            for (let i = 0; i < blades.length; i++) {
                const B1 = blades[i];
                for (let k = 0; k < rhs.blades.length; k++) {
                    const B2 = rhs.blades[k];
                    if (isNumber(metric)) {
                        const B = rcoE(B1, B2, field);
                        rez.push(B);
                    }
                    else if (isArray(metric)) {
                        const B = rcoL(B1, B2, metric, field);
                        rez.push(B);
                    }
                    else {
                        const B = rcoG(B1, B2, <Metric<T>>metric, field);
                        for (let b = 0; b < B.length; b++) {
                            rez.push(B[b]);
                        }
                    }
                }
            }
            return mv(simplify(rez, field), algebra, metric, labels);
        },
        __vbar__(rhs: Multivector<T>): Multivector<T> {
            // Use the definition of the scalar product in terms of the geometric product.
            return that.__mul__(rhs).extractGrade(0);
        },
        __wedge__(rhs: Multivector<T>): Multivector<T> {
            const rez: Blade<T>[] = [];
            for (let i = 0; i < blades.length; i++) {
                const B1 = blades[i];
                for (let k = 0; k < rhs.blades.length; k++) {
                    const B2 = rhs.blades[k];
                    const B = B1.__wedge__(B2);
                    rez.push(B);
                }
            }
            return mv(simplify(rez, field), algebra, metric, labels);
        },
        __bang__(): Multivector<T> {
            return that.inv();
        },
        __pos__(): Multivector<T> {
            return that;
        },
        neg(): Multivector<T> {
            const rez: Blade<T>[] = [];
            for (let i = 0; i < blades.length; i++) {
                const B = blades[i];
                rez.push(B.__neg__());
            }
            return mv(rez, algebra, metric, labels);
        },
        __neg__(): Multivector<T> {
            const rez: Blade<T>[] = [];
            for (let i = 0; i < blades.length; i++) {
                const B = blades[i];
                rez.push(B.__neg__());
            }
            return mv(rez, algebra, metric, labels);
        },
        __tilde__(): Multivector<T> {
            return that.rev();
        },
        cliffordConjugate(): Multivector<T> {
            const rez: Blade<T>[] = [];
            for (let i = 0; i < blades.length; i++) {
                const B = blades[i];
                rez.push(B.cliffordConjugate());
            }
            return mv(rez, algebra, metric, labels);
        },
        compress(fraction = 1e-12): Multivector<T> {
            let eps = field.mulByNumber(field.one, fraction);
            let max = field.zero;
            // Find the largest blade in absolute terms.
            for (let i = 0; i < blades.length; i++) {
                const B = blades[i];
                max = field.max(max, field.abs(B.weight));
            }
            const cutOff = field.mul(max, eps);
            const rez: Blade<T>[] = [];
            for (let i = 0; i < blades.length; i++) {
                const B = blades[i];
                if (field.ge(field.abs(B.weight), cutOff)) {
                    rez.push(B);
                }
            }
            return mv(rez, algebra, metric, labels);
        },
        direction(): Multivector<T> {
            const squaredNorm = that.scp(that.rev()).scalarCoordinate();
            const norm = field.sqrt(squaredNorm);
            if (!field.isZero(norm)) {
                return that.divByScalar(norm);
            }
            else {
                return that;
            }
        },
        exp(): Multivector<T> {
            // TODO: Optimize and Generalize.
            const B = extractGrade(2);
            const Brev = B.rev();
            const  = field.sqrt(B.__vbar__(Brev).scalarCoordinate());
            const i = B.divByScalar();
            const cos = mv([blade(0, field.cos(), field)], algebra, metric, labels);
            const sin = mv([blade(0, field.sin(), field)], algebra, metric, labels);
            return cos.__add__(i.__mul__(sin));
        },
        extractGrade,
        div(rhs: Multivector<T>): Multivector<T> {
            return that.mul(rhs.inv());
        },
        divByScalar(: T): Multivector<T> {
            const rez: Blade<T>[] = [];
            for (let i = 0; i < blades.length; i++) {
                const B = blades[i];
                const scale = field.div(B.weight, );
                if (!field.isZero(scale)) {
                    rez.push(blade(B.bitmap, scale, field));
                }
            }
            return mv(rez, algebra, metric, labels);
        },
        dual(): Multivector<T> {
            const n = dim(metric);
            const I = mv([blade((1 << n) - 1, field.one, field)], algebra, metric, labels);
            return that.__lshift__(I);
        },
        gradeInversion(): Multivector<T> {
            const rez: Blade<T>[] = [];
            for (let i = 0; i < blades.length; i++) {
                const B = blades[i];
                rez.push(B.gradeInversion());
            }
            return mv(rez, algebra, metric, labels);
        },
        rev(): Multivector<T> {
            const rez: Blade<T>[] = [];
            for (let i = 0; i < blades.length; i++) {
                const B = blades[i];
                rez.push(B.reverse());
            }
            return mv(rez, algebra, metric, labels);
        },
        scalarCoordinate(): T {
            for (let i = 0; i < blades.length; i++) {
                const B = blades[i];
                if (B.bitmap === 0) {
                    return B.weight;
                }
            }
            return field.zero;
        },
        scp(rhs: Multivector<T>): Multivector<T> {
            return that.__vbar__(rhs);
        },
        sqrt(): Multivector<T> {
            const rez: Blade<T>[] = [];
            for (let i = 0; i < blades.length; i++) {
                const B = blades[i];
                if (B.bitmap === 0) {
                    rez.push(blade(B.bitmap, field.sqrt(B.weight), field));
                }
                else {
                    throw new Error(`sqrt on arbitrary multivectors is not yet supported.`);
                }
            }
            return mv(rez, algebra, metric, labels);
        },
        asString(names: string[]): string {

            checkBasisLabels('names', names, dim(metric));

            if (blades.length === 0) {
                return "0";
            }
            else {
                let result = "";
                for (let i = 0; i < blades.length; i++) {
                    const B = blades[i];
                    const s = B.asString(names);
                    if (i === 0) {
                        result += s;
                    }
                    else {
                        // TODO: Fix this hackery...
                        if (s.charAt(0) === '-') {
                            result += ' - ';
                            result += s.substring(1);
                        }
                        else {
                            result += ' + ';
                            result += s;
                        }
                    }
                }
                return result;
            }
        },
        toString(): string {
            return that.asString(labels);
        }
    };
    return that;
}

/**
 * Verify that the basis vector labels are strings and that there are the correct number.
 */
function checkBasisLabels(name: string, labels: string[], n: number): void {
    if (isDefined(labels)) {
        if (isArray(labels)) {
            if (labels.length !== n) {
                throw new Error(`${name}.length must match the dimensionality of the vector space.`);
            }
            for (let i = 0; i < labels.length; i++) {
                const label = labels[i];
                if (!isString(label)) {
                    throw new Error(`${name}[${i}] must be a string.`);
                }
            }
        }
        else {
            throw new Error(`${name} must be a string[]`);
        }
    }
}

export function algebra<T>(metric: number | number[] | Metric<T>, field: FieldAdapter<T>, labels: string[]): Algebra<T> {
    mustBeDefined('metric', metric);
    const n = dim(metric);

    mustBeDefined('field', field);

    checkBasisLabels('labels', labels, n);

    const scalars: Multivector<T>[] = [];

    /**
     * A cache of the basis vectors.
     */
    const basisVectors: Multivector<T>[] = [];

    const that: Algebra<T> = {
        get () {
            return scalars[2];
        },
        get field() {
            return field;
        },
        get one() {
            return scalars[1];
        },
        get zero() {
            return scalars[0];
        },
        unit(index: number) {
            mustBeInteger('index', index);
            if (index >= 0 && index < n) {
                return basisVectors[index];
            }
            else {
                throw new Error(`index must be in range [0 ... ${n - 1})`);
            }
        },
        get units(): Multivector<T>[] {
            // For safety, return a copy of the cached array of basis vectors.
            return basisVectors.map(x => x);
        }
    };
    scalars[0] = getScalar(field.zero, that, metric, labels);
    scalars[1] = getScalar(field.one, that, metric, labels);
    scalars[2] = getScalar(field., that, metric, labels);
    for (let i = 0; i < n; i++) {
        basisVectors[i] = getBasisVector(i, that, metric, labels);
    }
    return that;
}

export function isArray<T>(x: any): x is T[] {
    return Object.prototype.toString.call(x) === '[object Array]';
}

export function isDefined(arg: any): boolean {
    return (typeof arg !== 'undefined');
}

export function isNumber(x: unknown): x is number {
    return (typeof x === 'number');
}

export function isString(s: unknown): boolean {
    return (typeof s === 'string');
}

export function isUndefined(arg: unknown): boolean {
  return (typeof arg === 'undefined');
}

import { isDefined } from '../checks/isDefined';
import { mustSatisfy } from '../checks/mustSatisfy';

function beDefined() {
    return "not be 'undefined'";
}

export function mustBeDefined(name: string, value: any, contextBuilder?: () => string): any {
    mustSatisfy(name, isDefined(value), beDefined, contextBuilder);
    return value;
}

/**
 * name 'must' message ['in' context].
 */
export function mustSatisfy(name: string, condition: boolean, messageBuilder: () => string, contextBuilder?: () => string) {
    if (!condition) {
        const message = messageBuilder ? messageBuilder() : "satisfy some condition";
        const context = contextBuilder ? " in " + contextBuilder() : "";
        throw new Error(name + " must " + message + context + ".");
    }
}

import { isInteger } from '../checks/isInteger';
import { mustSatisfy } from '../checks/mustSatisfy';

function beAnInteger() {
    return "be an integer";
}

export function mustBeInteger(name: string, value: number, contextBuilder?: () => string): number {
    mustSatisfy(name, isInteger(value), beAnInteger, contextBuilder);
    return value;
}

import { isNumber } from '../checks/isNumber';

export function isInteger(x: unknown): x is number {
    // % coerces its operand to numbers so a typeof test is required.
    // Not ethat ECMAScript 6 provides Number.isInteger().
    return isNumber(x) && x % 1 === 0;
}

import { isUndefined } from '../checks/isUndefined';
import { bitCount } from './bitCount';
import { canonicalReorderingSign } from './canonicalReorderingSign';
import { FieldAdapter } from './FieldAdapter';
import { minusOnePow } from './minusOnePow';
import { Blade, Metric } from './Multivector';

/**
 * The bitmap representation of a scalar.
 */
const SCALAR = 0;

export function blade<T>(b: number, weight: T, adapter: FieldAdapter<T>) {
    const that: Blade<T> = {
        get bitmap(): number {
            return b;
        },
        get weight(): T {
            return weight;
        },
        __neg__(): Blade<T> {
            return blade(b, adapter.neg(weight), adapter);
        },
        __vbar__(rhs: Blade<T>, _m: number | number[] | Metric<T>): Blade<T> {
            if (b !== rhs.bitmap) {
                return blade(SCALAR, adapter.zero, adapter);
            }
            else {
                return blade(SCALAR, adapter.mul(weight, rhs.weight), adapter);
            }
        },
        __wedge__(rhs: Blade<T>): Blade<T> {
            // If there are any vectors in common then the result is zero.
            if (b & rhs.bitmap) {
                return blade(SCALAR, adapter.zero, adapter);
            }
            else {
                const bitmap = b ^ rhs.bitmap;
                const sign = canonicalReorderingSign(b, rhs.bitmap);
                const newScale = adapter.mul(weight, rhs.weight);
                return blade(bitmap, sign > 0 ? newScale : adapter.neg(newScale), adapter);
            }
        },
        grade(): number {
            return bitCount(b);
        },
        reverse(): Blade<T> {
            const x = that.grade();
            const sign = minusOnePow(x * (x - 1) / 2);
            return blade(b, sign > 0 ? weight : adapter.neg(weight), adapter);
        },
        gradeInversion(): Blade<T> {
            const x = that.grade();
            const sign = minusOnePow(x);
            return blade(b, sign > 0 ? weight : adapter.neg(weight), adapter);
        },
        cliffordConjugate(): Blade<T> {
            const x = that.grade();
            const sign = minusOnePow(x * (x + 1) / 2);
            return blade(b, sign > 0 ? weight : adapter.neg(weight), adapter);
        },
        zero(): Blade<T> {
            return blade(SCALAR, adapter.zero, adapter);
        },
        asString(names?: string[]): string {
            let bladePart = "";
            let i = 1;
            let x = b;
            while (x !== 0) {
                if ((x & 1) !== 0) {
                    if (bladePart.length > 0) bladePart += " ^ ";
                    if (isUndefined(names) || (names === null) || (names === void 0) || (i > names.length) || (names[i - 1] == null)) {
                        bladePart = bladePart + "e" + i;
                    }
                    else {
                        bladePart = bladePart + names[i - 1];
                    }
                }
                x >>= 1;
                i++;
            }
            if (bladePart.length === 0) {
                return adapter.asString(weight);
            }
            else {
                if (adapter.isOne(weight)) {
                    return bladePart;
                }
                else {
                    return adapter.asString(weight) + " * " + bladePart;
                }
            }
        },
        toString(): string {
            return that.asString(void 0);
        }
    };
    return that;
}

export function bitCount(i: number): number {
    // Note that unsigned shifting (>>>) is not required.
    i = i - ((i >> 1) & 0x55555555);
    i = (i & 0x33333333) + ((i >> 2) & 0x33333333);
    i = (i + (i >> 4)) & 0x0F0F0F0F;
    i = i + (i >> 8);
    i = i + (i >> 16);
    return i & 0x0000003F;
}

import { bitCount } from './bitCount';
/**
 * Returns sign change due to putting the blade blades represented
 * by <code>a<code> and <code>b</code> into canonical order.
 */
export function canonicalReorderingSign(a: number, b: number): number {
    // Count the number of basis vector flips required to
    // get a and b into canonical order.
    a >>= 1;
    let sum = 0;
    while (a !== 0) {
        sum += bitCount(a & b);
        a >>= 1;
    }

    // even number of flips -> return +1
    // odd number of flips -> return -1
    // The test (sum & 1) === 0 evaluates to true for even numbers.
    return ((sum & 1) === 0) ? 1 : -1;
}

/**
 * pow(-1, i), i.e. (-1) raised to the i'th power.
 */
export function minusOnePow(i: number): number {
    return ((i & 1) === 0) ? 1 : -1;
}

import { blade } from './Blade';
import { canonicalReorderingSign } from './canonicalReorderingSign';
import { FieldAdapter } from './FieldAdapter';
import { Blade } from './Multivector';

export function gpE<T>(a: Blade<T>, b: Blade<T>, adapter: FieldAdapter<T>): Blade<T> {
    const bitmap = a.bitmap ^ b.bitmap;
    const sign = canonicalReorderingSign(a.bitmap, b.bitmap);
    const scale = adapter.mul(a.weight, b.weight);
    if (sign > 0) {
        return blade<T>(bitmap, scale, adapter);
    }
    else {
        return blade<T>(bitmap, adapter.neg(scale), adapter);
    }
}

