export function multivectorEQ<T>(lhs: Multivector<T>, rhs: Multivector<T>, field: FieldAdapter<T>): boolean {
    if (lhs.blades.length === rhs.blades.length) {
        const bladesL = sortBlades(lhs.blades);
        const bladesR = sortBlades(rhs.blades);
        const length = bladesL.length;
        for (let i = 0; i < length; i++) {
            const bladeL = bladesL[i];
            const bladeR = bladesR[i];
            if (bladeL.bitmap !== bladeR.bitmap) {
                return false;
            }
            if (field.ne(bladeL.weight, bladeR.weight)) {
                return false;
            }
        }
        return true;
    }
    else {
        return false;
    }
}

import { Blade } from './Multivector';

function compareFn<T>(a: Blade<T>, b: Blade<T>): number {
    if (a.bitmap < b.bitmap) {
        return -1;
    }
    else if (a.bitmap > b.bitmap) {
        return +1;
    }
    else {
        return 0;
    }
}

// TODO: This could be replaced by a more functional implementation using reduce?
export function sortBlades<T>(blades: Blade<T>[]): Blade<T>[] {
    const rez: Blade<T>[] = [];
    for (let i = 0; i < blades.length; i++) {
        const B = blades[i];
        rez.push(B);
    }
    rez.sort(compareFn);
    return rez;
}

