    }
    copy(dirty: boolean): InverseExpr {
        return new InverseExpr(this.inner, dirty);
    }
    reset(): InverseExpr {
        return new InverseExpr(this.inner.reset(), false);
    }
    simplify(): Expr {
        return new InverseExpr(this.inner.simplify());
    }
    toPrefix() {
        return `inverse(${this.inner})`;
    }
    toString() {
        return `!${this.inner}`;
    }
}

