export class Algebra implements Env {
    public basis: BasisBladeExpr[] = [];
    // private index: { [name: string]: number } = {};
    private _metric: number[][];
    private _bnames: string[] = [];
    constructor(g: number[][], _unused?: string[]) {
        this._metric = g;
        // TODO: Verify that the vectors is an array of strings.
        // TODO: Verify that the metric is a square array of numbers with the correct size.
        // Insert the basis blade corresponding to unity.
        // This primes the basis array for the steps that follow.
        this.basis.push(new BasisBladeExpr(this, []));
        this._bnames[0] = '1';
        // Insert the basis blades corresponding to the basis vectors.
        // The algorithm is to extend the existing blades by the new vector.
        for (let i = 0; i < this._metric.length; i++) {
            // const name = vectors[i];
            const vector = new BasisBladeExpr(this, [i]);
            // const index = Math.pow(2, i);
            // this.index[name] = index;
            const bLength = this.basis.length;
            for (let j = 0; j < bLength; j++) {
                const existing = this.basis[j];
                const extended = new WedgeExpr(existing, vector);
                const blade = this.simplify(extended);
                if (blade instanceof BasisBladeExpr) {
                    this.basis.push(blade);
                }
                else {
                    throw new Error(`${extended} must simplify to a BasisBladeExpr`);
                }
            }
        }
    }
    bladeName(vectors: number[]): string {
        if (vectors.length > 0) {
            return vectors.map((i) => {
                if (this._bnames) {
                    const basisIndex = Math.pow(2, i);
                    if (this._bnames[basisIndex]) {
                        return this._bnames[basisIndex];
                    }
                }
                return `e${i + 1}`;
            }).join(' ^ ');
        }
        else {
            // The scalar blade name has no vectors.
            return this._bnames[0];
        }
    }
    g(u: BasisBladeExpr, v: BasisBladeExpr): ScalarExpr {
        const i = u.vectors[0];
        const j = v.vectors[0];
        return new ScalarExpr(this, this._metric[i][j]);
    }
    scalar(value: number | string): Expr {
        return new ScalarExpr(this, value);
    }
    simplify(expr: Expr): Expr {
        let count = 0;
        if (expr instanceof Expr) {
            expr = expr.reset();
            expr = expr.simplify();
            while (expr.isChanged()) {
                expr = expr.reset();
                count++;
                if (count < 100) {
                    expr = expr.simplify();
                }
            }
            return expr;
        }
        else {
            throw new Error("expr must be an Expr");
        }
    }
}

import { cosineOfAngleBetweenBlades as cos } from './cosineOfAngleBetweenBlades';
import { Algebra, Multivector } from './Multivector';

/**
 * Determines a versor for two frames related by an orthogonal transform.
 *
 * A and B are lists of corresponding vectors, representing the frames.
 * A is the start frame, B is the final frame.
 * V should be initialized to 1 in whatever multivector/field flavor you are using.
 *
 * This is an application of the Cartan-Dieudonne theorem that states:
 * In n-D, any orthogonal transformation can be represented as at most n planar reflections.
 */
export function orthoFramesToVersor<T>(A: Multivector<T>[], B: Multivector<T>[], vs: Multivector<T>[], algebra: Algebra<T>): Multivector<T>[] {
    if (A.length > 0) {
        const j = bestIndex(A, B, algebra);
        const a = A[j];
        const b = B[j];
        const e = a.sub(b);
        const field = algebra.field;
        const eps = field.mulByNumber(field.one, 1e-6);

        const cosMinusOne = cos(a, b).sub(algebra.one).scalarCoordinate();
        const tooClose = field.lt(field.abs(cosMinusOne), eps);
        if (tooClose) {
            return orthoFramesToVersor(removeAt(A, j), removeAt(B, j), vs, algebra);
        }
        else {
            const e2 = e.scp(e).scalarCoordinate();
            const rvs = prepend(vs, e.divByScalar(algebra.field.sqrt(e2)));
            // Don't let irrational number rounding errors from sqrt propagate...
            return orthoFramesToVersor(removeAt(A, j).map(x => e.mul(x.mul(e)).neg().divByScalar(e2)), removeAt(B, j), rvs, algebra);
        }
    }
    else {
        return vs;
    }
}

function prepend<T>(xs: T[], x: T): T[] {
    const result: T[] = [];
    result.push(x);
    for (let i = 0; i < xs.length; i++) {
        result.push(xs[i]);
    }
    return result;
}

/**
 * Returns a copy of the array with the element at index removed.
 */
function removeAt<T>(xs: T[], index: number): T[] {
    const result: T[] = [];
    for (let i = 0; i < xs.length; i++) {
        if (i !== index) {
            result.push(xs[i]);
        }
    }
    return result;
}

/**
 * Determine the best vector for numerical stability.
 */
function bestIndex<T>(A: Multivector<T>[], B: Multivector<T>[], algebra: Algebra<T>): number {
    const N = A.length;
    let max = algebra.zero;
    let idx = 0;
    for (let k = 0; k < N; k++) {
        const x = A[k].sub(B[k]);
        const squaredNorm = x.scp(x.rev()).scalarCoordinate();
        if (algebra.field.gt(squaredNorm, max.scalarCoordinate())) {
            idx = k;
        }
    }
    return idx;
}

import { Multivector } from './Multivector';
import { norm } from './norm';

/**
 * The cosine of the angle between two blades.
 */
export function cosineOfAngleBetweenBlades<T>(A: Multivector<T>, B: Multivector<T>): Multivector<T> {
    const a = norm(A).scalarCoordinate();
    const b = norm(B).scalarCoordinate();
    return A.scp(B.rev()).divByScalar(a).divByScalar(b);
}

import { Multivector } from './Multivector';
import { squaredNorm } from './squaredNorm';

export function norm<T>(A: Multivector<T>): Multivector<T> {
    return squaredNorm(A).sqrt();
}

import { Multivector } from './Multivector';

export function squaredNorm<T>(A: Multivector<T>): Multivector<T> {
    return A.scp(A.rev());
}
